import React, { useRef, useState } from 'react'
import './Tictoc.css'
import roundshape from '../assets/circle.png'
import crossicon from '../assets/tic.png'

let data= ["", "","","","","","","",""];



const Tictoc = () => {
  let [count, setcount] = useState(0);
  let [lock, setlock] = useState(false);
  let titleRef = useRef(null);
  let box1 = useRef(null)
  let box2 = useRef(null)
  let box3 = useRef(null)
  let box4 = useRef(null)
  let box5 = useRef(null)
  let box6 = useRef(null)
  let box7 = useRef(null)
  let box8 = useRef(null)
  let box9 = useRef(null)

let  box_array = [box1,box2,box3,box4,box5,box6,box7,box8,box9]




  const toggle = (e,num)=>{
if(lock){
  return 0;
}
if(count%2===0){
e.target.innerHTML = `<img src='${crossicon}' >`;
data[num]="x";
setcount(++count)
}
else{
  e.target.innerHTML = `<img src='${roundshape}' >`;
data[num]="o";
setcount(++count)

}
checkwin()
  }

const checkwin = ()=>{
  if(data[0]===data[1] && data[1]===data[2] && data[2]!=='')
{
won(data[2])
}
else if(data[3]===data[4] && data[4]===data[5] && data[5]!==''){
  won(data[5])
}
else if(data[6]===data[7] && data[7]===data[8] && data[8]!==''){
  won(data[8])
}
else if(data[0]===data[3] && data[3]===data[6] && data[6]!==''){
  won(data[6])
}
else if(data[1]===data[4] && data[4]===data[7] && data[7]!==''){
  won(data[7])
}
else if(data[2]===data[5] && data[5]===data[8] && data[8]!==''){
  won(data[8])
}
else if(data[0]===data[4] && data[4]===data[8] && data[8]!==''){
  won(data[8])
}
else if(data[0]===data[1] && data[1]===data[2] && data[2]!==''){
  won(data[2])
}
else if(data[2]===data[4] && data[4]===data[6] && data[6]!==''){
  won(data[6])
}

}

const won =(winner) =>{
  setlock(true)
  if(winner==="x"){
titleRef.current.innerHTML = `Congrattulations: <img src=${crossicon}> Wins `;
  }
  else{
    titleRef.current.innerHTML = `Congrattulations: <img src=${roundshape}> Wins `;
  }
}
const reset =()=>{
  setlock(false);
  data= ["", "","","","","","","",""];
  titleRef.current.innerHTML = 'Tic Tac Toe With <span>React</span>'
  box_array.map((e)=>{
    e.current.innerHTML = "";
  })
}

  return (
    <div className='container'>
      <h1 className='title' ref={titleRef}> Tic Toe Toe with <span>React</span> </h1>
      <div className="board">
<div className="row1">
  <div className="boxex" ref={box1} onClick={(e)=>{toggle(e,0)}}></div>
  <div className="boxex"  ref={box2} onClick={(e)=>{toggle(e,1)}}></div>
  <div className="boxex"  ref={box3} onClick={(e)=>{toggle(e,2)}}></div>
</div>
<div className="row2">
  <div className="boxex"  ref={box4} onClick={(e)=>{toggle(e,3)}}></div>
  <div className="boxex"  ref={box5} onClick={(e)=>{toggle(e,4)}}></div>
  <div className="boxex"  ref={box6} onClick={(e)=>{toggle(e,5)}}></div>
</div>
<div className="row3">
  <div className="boxex"  ref={box7} onClick={(e)=>{toggle(e,6)}}></div>
  <div className="boxex"  ref={box8} onClick={(e)=>{toggle(e,7)}}></div>
  <div className="boxex"  ref={box9} onClick={(e)=>{toggle(e,8)}}></div>
</div>
      </div>
      <button onClick={()=>{reset()}} className='reset'>Reset</button>
    </div>
  )
}

export default Tictoc
